import React from 'react';
import { Form, Input, Button, Row, Col, message } from 'antd';

const Contact = () => {
  const onFinish = (values) => {
    console.log('Form Values:', values);
    message.success('Başarıyla gönderildi');
  };

  return (
    <div style={{ padding: '5px', background: 'rgba(0, 0, 0, 0.5)', color: 'white', textAlign: 'center', borderRadius: '30px'  }}>
      <h2>İletişim</h2>
      <Row gutter={16} justify="center">
        <Col span={8}>
          <div style={{ textAlign: 'left' }}>
            <p><strong>Adresimiz:</strong> Cengiz Topel Caddesi, No: 18/A
Etiler, Beşiktaş
İstanbul, Türkiye</p>
            <p><strong>Çalışma Saatlerimiz:</strong> Pazartesi-Cuma: 09:00 - 23:00 </p>
            <p><strong>Email:</strong> Querencia@gmail.com</p>
            <p><strong>Telefon Numaramız:</strong> +905321234567</p>
          </div>
        </Col>
        <Col span={12}>
          <Form layout="vertical" onFinish={onFinish}>
            <Form.Item
              label="Adınız ve Soyadınız"
              name="name"
              rules={[{ required: true, message: 'Lütfen adınızı ve soyadınızı girin!' }]}
            >
              <Input placeholder="Adınız ve Soyadınız" />
            </Form.Item>
            <Form.Item
              label="Email"
              name="email"
              rules={[{ required: true, message: 'Lütfen email adresinizi girin!' }, { type: 'email', message: 'Geçerli bir email adresi girin!' }]}
            >
              <Input placeholder="Email" />
            </Form.Item>
            <Form.Item
              label="Mesaj"
              name="message"
              rules={[{ required: true, message: 'Lütfen mesajınızı girin!' }]}
            >
              <Input.TextArea rows={4} placeholder="Mesaj" />
            </Form.Item>
            <Form.Item>
              <Button type="primary" htmlType="submit">Gönder</Button>
            </Form.Item>
          </Form>
        </Col>
      </Row>
    </div>
  );
};

export default Contact;
